import React from 'react'
import { Container,Row,Col } from 'react-bootstrap'
const Footer = () => {
 const newYear = currentDate.getFullYear()
    return (
    <div>
      <Container>
        <Row>
            <Col>
             <p>Neko-manga &copy; {newYear} </p>            
            </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Footer
